pragma solidity >=0.7.0 <0.9.0;

//contract defination 
contract transferAmount{

//state variable
 address owner;
 address payable  receiver;

  uint balance;
 //constructor 


 //modifier
  

 //function
   //get balance 
   //send balance

   function setReceiverAccount() public  {
       receiver=payable (msg.sender);
      
   }

function setOwnerAccount() public {
    owner=msg.sender;
}
    

function sendBalance(uint ) payable  public {
       require(msg.sender==owner);
       balance=msg.value;
    receiver.transfer(balance);

}
 function getOwenerBalance() public view returns (uint){
     require(owner==msg.sender);
           return address(msg.sender).balance;
     }

      function getReceiverBalance() public view returns (uint){
          require(receiver==msg.sender);
           return address(msg.sender).balance;
     }
}

